import React,{ Component } from 'react';

class Forms extends Component {
    constructor(props) {
        super(props);
    }
    render() {
        return(
            <div>
                <form>
                    <label>
                        Name:
                        <input type='text' name='name' />
                    </label>
                    <input type='submit' value='Submit'/>
                </form>
            </div>
        )
    }
}

export default Forms;
